import React from 'react';
import { useLocation } from 'react-router-dom';
import { AiOutlineMail } from 'react-icons/ai';
import { CgWebsite } from 'react-icons/cg';
import { BsTelephone } from 'react-icons/bs';

const Resume = () => {
    const location = useLocation();
    const { userObject, imageSource } = location.state || {};

    return (
        <div className='resume-card'>
            <div className='resume-card-inner'>
                <div className='section section-1'>
                    <h3 className='full-name'>{userObject.firstName} {userObject.lastName}</h3>
                    <p className='age'>{userObject.age} years old</p>
                </div>
                <div className='section section-3'>
                    <h3>Summary</h3>
                    <p className='profile-info'>{userObject.profile}</p>
                </div>
                <div className='section section-2'>
                    <ul>
                        <li className='phone'><BsTelephone className='icons' /> {userObject.phone}</li>
                        <li className='email'><AiOutlineMail className='icons' /> {userObject.email}</li>
                        {userObject.website && <li className='website'><CgWebsite className='icons' /> {userObject.website}</li>}
                    </ul>
                </div>
                <div className='section section-4 column'>
                    <h4 className='horizontal'>Skills</h4>
                    <p className='skill-title info'>{userObject.skills}</p>
                </div>
                <div className='section section-5 column'>
                    <h4 className='horizontal'>Experience</h4>
                    <p>{userObject.experience}</p>
                </div>
                <div className='section section-6 column'>
                    <h4 className='horizontal'>Education</h4>
                    <p className='university-name'>{userObject.uni}</p>
                </div>
                <div className='section section-7 column'>
                    <h4 className='horizontal'>Certifications</h4>
                    <p>{userObject.certs}</p>
                </div>
                <div className='section section-8 column'>
                    <h2 className='grad-year'>CLASS OF {userObject.gradYear}</h2>
                </div>
            </div>
        </div>
    );
};

export default Resume;
